package pqdong.face.recognition;

import com.tencentcloudapi.common.Credential;
import com.tencentcloudapi.common.profile.ClientProfile;
import com.tencentcloudapi.common.profile.HttpProfile;
import com.tencentcloudapi.common.exception.TencentCloudSDKException;

import com.tencentcloudapi.iai.v20200303.IaiClient;
import com.tencentcloudapi.iai.v20200303.models.*;;

public class SearchFacesTest {
    public static void main(String [] args) {
        try{

            Credential cred = new Credential("", "");

            HttpProfile httpProfile = new HttpProfile();
            httpProfile.setEndpoint("iai.tencentcloudapi.com");

            ClientProfile clientProfile = new ClientProfile();
            clientProfile.setHttpProfile(httpProfile);

            IaiClient client = new IaiClient(cred, "ap-beijing", clientProfile);

            SearchFacesRequest req = new SearchFacesRequest();
            String[] groupIds1 = {"face"};
            req.setGroupIds(groupIds1);

            req.setImage("data:image/jpg;base64,");
            req.setMaxFaceNum(5L);
            req.setMinFaceSize(1L);
            req.setMaxPersonNum(5L);

            SearchFacesResponse resp = client.SearchFaces(req);

            System.out.println(SearchFacesResponse.toJsonString(resp));
        } catch (TencentCloudSDKException e) {
            System.out.println(e.toString());
        }

    }

}